    [4763] = "Füllt die leere Säuberungsschale am Mondbrunnen in Auberdine.\n\nHolt jeweils eine Probe von Früchten, Nüssen und Getreide aus dem Lager der Schwarzfellfurbolgs im Norden.\n\nMischt alles in der Schale und stellt diese bei dem Freudenfeuer neben dem Cliffspring auf Höhe des nördlichen Lagers ab und lockt dadurch den Satyrverderber an.\n\nNehmt den Talisman der Verderbnis und bringt ihn zu Thundris Windwirker in Auberdine.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - 1 x Talisman der Verderbnis",
