    [4811] = "Reist von Auberdine nach Osten und sucht nach einem großen, roten Kristall entlang der östlichen Bergkette von Dunkelküste. Informiert Schildwache Glynda Nal'Shea in Auberdine über Eure Erkenntnisse.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Findet den großen roten Kristall am östlichen Gebirgszug von Dunkelküste",
