    [5929] = "Sucht den großen Bärengeist im nordwestlichen Moonglade auf und lernt alles, was er Euch über die Natur des Bären mitzuteilen hat. Wenn Ihr das erledigt habt, kehrt zu Dendrite Starblaze nach Nighthaven in Moonglade zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Sucht den großen Bärengeist auf und lernt alles, was er Euch über die Natur des Bären mitzuteilen hat.",
