    [6001] = "Benutzt den Mondstaub des Cenarius mit dem Moonkinstein, um Mondklaue herauszulocken. Danach müsst Ihr Euch Mondklaue stellen und Euch die Kraft des Körpers und des Herzens verdienen, die er besitzt.\n\nSprecht mit Mathrengyl Bearwalker in Darnassus, wenn Ihr fertig seid.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Stellt Euch Mondklaue und verdient Euch die Kraft des Körpers und des Herzens, die er besitzt.",
