    [2876] = "Berichtet den Behörden des Dampfdruckpiers von den Schiffzeitplänen.",
    [2877] = "Tötet 10 grüne Schlicke sowie 10 jadegrüne Schlamme und meldet Euch dann wieder bei Fraggar Donnermantel beim Nistgipfel.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Grüner Schlick x 10\n - Jadegrüner Schlamm x 10",
    [2879] = "Aktiviert Troyas Stock und findet den Monolithen von Equinex.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Stock von Equinex x 1",
    [2880] = "Bringt Fraggar Donnermantel beim Nistgipfel 5 Trollstammeshalsketten.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Trollstammeshalskette x 5",
    [2902] = "Findet die Schlachtpläne der Gnolle irgendwo in den Gnoll-Lagern südlich vom Camp Mojache.",
    [2903] = "Bringt die Schlachtpläne der Waldpfoten zu Hadoken Flinkschreiter ins Camp Mojache.",
    [2932] = "Sammelt Schädel der Bleichborken und hängt sie an Nimboyas Pike. Platziert Nimboyas behängte Pike in einem der Bleichborkendörfer im Hinterland und kehrt dann zu Nimboya ins Schlingendorntal zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hinterlasst die grausige Botschaft.",
    [2933] = "Bringt eine Giftflasche zu einem Apotheker nach Tarrens Mühle.",
    [2934] = "Bringt Apotheker Lydon in Tarrens Mühle einen unbeschädigten Giftbeutel.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Unbeschädigter Giftbeutel x 1",
    [2939] = "Sprecht mit Daryn Leuchtwind im Dorf Rut'theran.",
    [2940] = "Fragt Daryn Leuchtwind, ob Ihr Euch ihr Buch ausleihen dürft.",
    [2941] = "Bringt den Brief zu Curgle Kurbelhüpf nach Tanaris.",
    [2942] = "Bringt den funkelnden Stein und den Stock von Equinex zu Troyas Mondhauch in die Mondfederfeste.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Ein funkelnder Stein x 1",
    [2943] = "Liefert das Buch bei Troyas Mondhauch in der Mondfederfeste ab.",
    [2944] = "Benutzt den Superschnapper FX, um einen Schnappschuss von Gammerita zu machen, und kehrt dann zu Daryn Leuchtwind nach Rut'theran zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schnappschuss von Gammerita x 1",
    [2969] = "Befreit mit dem Bambuskäfigschlüssel die Grimmlingflitzer aus dem Pferch im Grimmtotemlager. Kindal Mondweber sowie mindestens 6 Grimmlingflitzer müssen überleben.\n\nIhr habt 6 Minuten, bis Kindal beschließt, dass es Zeit zum Rückzug und Eure Aufgabe gescheitert ist.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Rettet mindestens 6 Grimmlingflitzer aus der Gefangenschaft.",
    [2970] = "Tötet 12 Naturalisten der Grimmtotem, 10 Räuber der Grimmtotem sowie 6 Schamanen der Grimmtotem und kehrt dann zu Jer'kai Mondweber nach Feralas zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Naturalist der Grimmtotem x 12\n - Räuber der Grimmtotem x 10\n - Schamane der Grimmtotem x 6",
    [2972] = "Bringt Jer'kais Siegelring zu Hohepriesterin Tyrande Wisperwind nach Darnassus.",
    [2973] = "Bringt 10 regenbogenfarbene Grimmlingflitzerflügel zu Krueg Schädelspalter nach Camp Mojache.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schillernder Grimmlingflitzerflügel x 10",
    [2974] = "Bringt 20 Grimmtotemhörner zu Krueg Schädelspalter nach Camp Mojache.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Grimmtotemhorn x 20",
    [2975] = "Rok Orhan im Camp Mojache will, dass Ihr 10 Oger der Gordunni, 10 Magier der Gordunni und 5 Schläger der Gordunni tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Oger der Gordunni x 10\n - Ogermagier der Gordunni x 10\n - Schläger der Gordunni x 5",
    [2976] = "Bringt die Kiste mit Grimmtotemhörnern zu Belgrom Felshammer nach Orgrimmar.",
    [2978] = "Bringt die Gordunnischriftrolle zu Rok Orhan ins Camp Mojache.",
    [2979] = "Rok Orhan im Camp Mojache will, dass Ihr eine Gordunnikugel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gordunnikugel x 1",
    [2980] = "Rok Orhan im Camp Mojache will, dass Ihr 10 Schamanen der Gordunni, 10 Hexenmeister der Gordunni und 5 Raufer der Gordunni tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schamane der Gordunni x 10\n - Hexenmeister der Gordunni x 10\n - Raufer der Gordunni x 5",
    [2982] = "Angelas Mondhauch will, dass Ihr 8 Hexenmeister der Gordunni, 8 Schamanen der Gordunni und 8 Schläger der Gordunni tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hexenmeister der Gordunni x 8\n - Schamane der Gordunni x 8\n - Schläger der Gordunni x 8",
    [2987] = "Orwin Gizzmick im Camp Mojache will 12 Proben Gordunnikobalt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gordunnikobalt x 12",
    [2988] = "Durchsucht die Käfige in den beiden Dörfern der Bleichborken und kehrt dann zu Greifenmeister Krallenaxt zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Überprüft den ersten Käfig. x 1\n - Überprüft den zweiten Käfig. x 1\n - Überprüft den dritten Käfig. x 1",
    [2989] = "Überprüft die Oberfläche des Altars von Zul und kehrt dann zu Greifenmeister Krallenaxt zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Durchsucht den Altar von Zul.",
    [2990] = "Bringt Scharfschnabels Feder zu Thadius Grimmschatten in die verwüsteten Lande.",
    [2995] = "Oran Schlangenfuß in Unterstadt will, dass Ihr ins Hinterland reist und die Hochtalaufzeichnungen, Hochtalberichte und Hochtalnotizen verbrennt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Verbrennt die Hochtalaufzeichnungen. x 1\n - Verbrennt die Hochtalnotizen. x 1\n - Verbrennt den Hochtalbericht. x 1",
    [3002] = "Bringt die Gordunnikugel zu Uthel'nay in die Dunkeldornenlodge in Orgrimmar.",
    [3022] = "Bringt die sorgfältig verpackte Kiste zu Erelas Himmelsbern in das Dorf Rut'theran.",
    [3062] = "Talo Dornhuf im Camp Mojache will das dunkle Herz von Edana Hasskralle.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Edanas dunkles Herz x 1",
    [3063] = "Talo Dornhuf möchte, dass Ihr 4 Harpyien der Nordschwingen, 4 Wildfedern der Nordschwingen, 4 Windruferinnen der Nordschwingen und 4 Töter der Nordschwingen erschlagt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Harpyie der Nordschwingen x 4\n - Wildfeder der Nordschwingen x 4\n - Töterin der Nordschwingen x 4\n - Windruferin der Nordschwingen x 4",
    [3113] = "Lest das verschlüsselte Memorandum und sprecht mit Solm Hargrin im Eisklammtal.",
    [3121] = "Bringt den Schrumpfkopf zu Xerash Feuerklinge beim Larisspavillon.",
    [3122] = "Bringt Xerashs Kräuterbeutel zu Hexendoktor Uzer'i in Feralas.",
    [3123] = "Tötet 10 Eisenfellbären oder Langzahnläufer und benutzt dann das Gefäß für Bestienmuisek, um die gefallenen Tiere zu schrumpfen und einzufangen.\n\nBringt anschließend 10 Einheiten Bestienmuisek und das Gefäß für Bestienmuisek zu Hexendoktor Uzer'i in Feralas.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Bestienmuisek x 10",
    [3124] = "Schaltet 10 Fransenfederhippogryphen eines beliebigen Typs aus und benutzt dann das Muisekgefäß, um sie zu schrumpfen und einzufangen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hippogryphenmuisek x 10",
    [3125] = "Schaltet 8 Grimmlingflitzer oder Grimmlingdrachen aus. Benutzt das Muisekgefäß, um die gefallenen Feendrachen zu schrumpfen und einzufangen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Feendrachenmuisek x 8",
    [3126] = "Schaltet 3 umherwandernde Waldgänger aus. Benutzt das Muisekgefäß, um die gefallenen Treants zu schrumpfen und einzufangen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Treantmuisek x 3",
    [3127] = "Schaltet 7 Landgänger oder Klippenriesen aus. Benutzt das Muisekgefäß, um die gefallenen Bergriesen zu schrumpfen und einzufangen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Bergriesenmuisek x 7",
    [3128] = "Bringt 2 abgesplitterte Baumstämme, 6 verkrustete Mineralien, 20 Stücke widerstandsfähige Sehne und 40 metallische Fragmente zu Hexendoktor Uzer'i ins Camp Mojache.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Abgesplitterter Baumstamm x 2\n - Verkrustete Mineralien x 6\n - Widerstandsfähige Sehne x 20\n - Metallische Fragmente x 40",
    [3129] = "Hexendoktor Uzer'i will, dass Ihr einen Moment wartet, während er die Waffen vorbereitet.",
    [3130] = "Meldet Euch bei Latronicus Mondspeer in der Mondfederfeste.",
    [3161] = "Marvon Nietensucher in Tanaris möchte, dass Ihr 30 Ornamente von Gahz'ridian sammelt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Ornament von Gahz'ridian x 30",
    [3181] = "Bringt Margols gigantisches Horn zu Gebirgsjägerin Feinkiesel.",
    [3182] = "Bringt Margols gigantisches Horn zu Kurator Thorius in Eisenschmiede.",
    [3201] = "Bringt die Beweisurkunde zurück zu Gebirgsjägerin Feinkiesel.",
    [3362] = "Tran'rek in Gadgetzan möchte, dass Ihr 8 knorrige Distelwandler und 8 Distelwurzelformer erledigt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Knorriger Distelwandler x 8\n - Distelwurzelformer x 8",
    [3367] = "Helft Dorius, zurück nach Eisenschmiede zu kommen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Dorius' Begleitung",
    [3368] = "Bringt den angesengten Brief zu Thorius in Eisenschmiede. Er befindet sich in der Halle der Forscher.",
    [3371] = "Kehrt zur sengenden Schlucht zurück und sucht Dorius' Archäologenteam.",
    [3372] = "Sucht das geheimnisvolle Artefakt, das im nordwestlichen Teil der Sengenden Schlucht von den Götzendienern des Schattenhammerklans bewacht wird, und bringt es zum Altar von Suntara in der Schlackengrube.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geheimnisvolles Artefakt x 1",
    [3377] = "Hört Zamaels Geschichte.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Zamaels Geschichte",
    [3378] = "Findet das Gebet an Elune und bringt es zu Astarii Sternsucher in Darnassus.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gebet an Elune x 1",
    [3380] = "Sucht Marvon Nietensucher in Tanaris.",
    [3381] = "Bringt 2 unbeschädigte Hippogryphenfedern zu Sanath Lim-yo in Azshara, wenn Ihr mit seinem Meister sprechen wollt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Unbeschädigte Hippogryphenfeder x 2",
    [3441] = "Lasst Velarok Windklinge seine Geschichte erzählen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Velaroks Geschichte",
    [3442] = "Sammelt 4 Herzen der Flamme und 4 Kugeln Golemöl und bringt die Gegenstände zu Velarok Windklinge.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Herz der Flamme x 4\n - Golemöl x 4",
    [3443] = "Bringt 8 mit Thorium beschichtete Dolche zu Velarok Windklinge.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Thoriumbeschichteter Dolch x 8",
    [3444] = "Holt den Steinreif aus Marvon Nietensuchers Werkstatt in Ratschet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Steinreif x 1",
    [3445] = "Sucht Marvon Nietensucher in Tanaris.",
    [3448] = "Sprecht mit Magier Tymor in Eisenschmiede.",
    [3449] = "Verwendet das Abschriftenset, um Abpausbilder von der Rune von Beth'Amara, der Rune von Jin'yael, der Rune von Markri und der Rune von Sael'hai herzustellen, bevor Ihr Euch zu der kleinen Insel vor der südlichen Halbinsel von Azshara aufmacht und dem Piloten Xiggs Luntenzünder signalisiert, dass er sie abholen kann.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Abpausbild: Rune von Beth'Amara x 1\n - Abpausbild: Rune von Jin'yael x 1\n - Abpausbild: Rune von Markri x 1\n - Abpausbild: Rune von Sael'hai x 1",
    [3450] = "Sprecht mit Xiggs Luntenzünder in Eisenschmiede.",
    [3451] = "Sprecht mit Xiggs Luntenzünder in Eisenschmiede und erhaltet von ihm eine Standardleuchtpistole.",
    [3452] = "Bringt ein Symbol von Ragnaros zu Velarok Windklinge.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Symbol von Ragnaros x 1",
    [3453] = "Wartet bis Velarok Windklinge die Fackel der Vergeltung vollendet hat.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Fackelerschaffung",
    [3454] = "Nehmt die Fackel der Vergeltung.",
    [3461] = "Bringt Magier Tymors Abschriftenset zu ihm zurück nach Eisenschmiede.",
    [3462] = "Sprecht mit dem Knappen Malzdarr.",
    [3463] = "Steckt die Wachpostentürme im Norden, Süden, Osten und Westen in Brand, indem Ihr die Fackel der Vergeltung innerhalb der einzelnen Gebäude benutzt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Westturm in Flammen x 1\n - Südturm in Flammen x 1\n - Ostturm in Flammen x 1\n - Nordturm in Flammen x 1",
    [3481] = "Öffnet die Truhe.",
    [3501] = "Bringt Kum'isha unvollständige Draenethystfragmente und Ihr werdet für jedes, das Ihr bringt, belohnt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Unvollständiges Draenethystfragment x 1",
    [3504] = "Bringt den versiegelten Brief zu Ag'tor Blutfaust nach Azshara.",
    [3505] = "Tötet 10 Blutelfeneintreiber und 10 Blutelfenfeldmesser, bevor Ihr Magus Rimtoris Lager sucht. Sobald Ihr es gefunden habt, sucht nach etwas, das für sie von Bedeutung ist und das wir nehmen können, um sie in einen Kampf zu locken.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutelfeneintreiber x 10\n - Blutelfenfeldmesser x 10\n - Magus Rimtoris Lager finden",
    [3506] = "Zerstört den arkanen Fokussierkristall, der an Magus Rimtori gebunden ist, und tötet sie danach. Bringt dann den Kopf von Magus Rimtori zu Ag'tor Blutfaust nach Azshara.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kopf von Magus Rimtori x 1",
    [3507] = "Sprecht mit Belgrom Felshammer in Orgrimmar.",
    [3517] = "Sucht die Schrifttafel von Beth'Amara, die Schrifttafel von Jin'yael, die Schrifttafel von Markri und die Schrifttafel von Sael'hai, bevor Ihr zu Jediga in Azshara zurückkehrt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schrifttafel von Beth'Amara x 1\n - Schrifttafel von Jin'yael x 1\n - Schrifttafel von Markri x 1\n - Schrifttafel von Sael'hai x 1",
    [3518] = "Bringt die Schrifttafel von Beth'Amara zu Magatha in Donnerfels.",
    [3520] = "Fangt die Geister von 3 Kreischern in Feralas ein und kehrt dann zu Yeh'kinya beim Dampfdruckpier zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gesammelte Kreischergeister x 3",
    [3541] = "Bringt die Schrifttafel von Jin'yael zu Jes'rimon nach Orgrimmar.",
    [3542] = "Bringt die Schrifttafel von Markri zu Andron Gant nach Unterstadt.",
    [3561] = "Bringt die Schrifttafel von Sael'hai zu Erzmagier Xylem in Azshara.",
    [3562] = "Bringt Magathas Notiz zu Jediga in Azshara.",
    [3563] = "Bringt Jes'rimons Notiz zu Jediga in Azshara.",
    [3564] = "Bringt Androns Notiz zu Jediga in Azshara.",
    [3565] = "Bringt Xylems Notiz zu Jediga in Azshara.",
    [3566] = "Tötet Lathoric den Schwarzen und Obsidion. Kehrt zurück zu Thorius nach Eisenschmiede mit dem Kopf von Lathoric dem Schwarzen und dem Herzen von Obsidion.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kopf von Lathoric dem Schwarzen x 1\n - Herz von Obsidion x 1",
    [3568] = "Füllt alle 4 leeren Phiolen an den Gezeitenteichen entlang der Küste der Ruinen von Eldarath in Azshara und kehrt dann zu Chemiker Miesmut zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gefüllte Phiole markiert mit Nr. 1 x 1\n - Gefüllte Phiole markiert mit Nr. 2 x 1\n - Gefüllte Phiole markiert mit Nr. 3 x 1\n - Gefüllte Phiole markiert mit Nr. 4 x 1",
    [3569] = "Gebt Miesmuts Elixier Thersa Windweise in Unterstadt.",
    [3601] = "Durchsucht den thalassischen Stützpunkt nach Kim'jaels Kompass, Zielfernrohr, ausgestopftem Huhn und Knobelwizz und bringt ihm dann alles nach Azshara zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kim'jaels Kompass x 1\n - Kim'jaels Zielfernrohr x 1\n - Kim'jaels gefülltes Huhn x 1\n - Kim'jaels Knobelwizz x 1",
    [3661] = "Sammelt 15 Wildekinfedern aus dem Hinterland für Erelas Himmelsbern in Rut'theran.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wildekinfeder x 15",
    [3701] = "Begebt Euch zu den Ruinen von Thaurissan in der brennenden Steppe und sammelt Informationen über die Relikte von Thaurissan. Kehrt zur königlichen Historikerin Archesonus zurück, wenn Ihr die Informationen besorgt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Informationen besorgt x 12",
    [3702] = "Hört die Erzählung der königlichen Historikerin Archesonus über die Geschichte von Thaurissan.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Die Geschichte von Thaurissan",
    [3761] = "Bringt 20 Erdproben von Un'Goro zu Ghede auf der Anhöhe der Ältesten in Donnerfels.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Erde von Un'Goro x 20",
    [3764] = "Bringt 20 Erdproben von Un'Goro zu Jenal in der Enklave des Cenarius in Darnassus.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Erde von Un'Goro x 20",
    [3781] = "Bringt den Samenkorngutschein des Erzdruiden zu Mathrengyl Bärenfährte in der Enklave des Cenarius des Darnassus.",
    [3782] = "Bringt den Samenkorngutschein zu Bashana Runentotem in Donnerfels.",
    [3783] = "Sammelt 10 dicke Yetifelle für Umi Rumpelkicher in der Ewigen Warte.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Dickes Yetifell x 10",
    [3785] = "Benutzt einen Immergrünbeutel mit einem Paket Tharlendrissamenkörner sowie zwei Erdproben von Un'Goro, um Morgenkorn zu kultivieren.\n\nBringt 10 Einheiten Morgenkorn zu Mathrengyl Bärenfährte in Darnassus.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Morgenkorn x 10",
    [3790] = "Sprecht mit Erzdruide Fandral Hirschhaupt in Darnassus.",
    [3821] = "Begebt Euch in die brennende Steppe und findet heraus, was aus Sha'ni Ehrenhauer geworden ist.",
    [3822] = "Holt Sha'nis Nasenring von Krom'Grul zurück und bringt ihn zu Thal'trak in Kargath. Durchsucht die verschiedenen Höhlen und Minen im Schreckensfels.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Sha'nis Nasenring x 1",
    [3823] = "Tötet 15 Ogermagier der Feuermägen, 7 Oger der Feuermägen sowie 7 Schläger der Feuermägen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Ogermagier der Feuermägen x 15\n - Oger der Feuermägen x 7\n - Schläger der Feuermägen x 7",
    [3824] = "Beschafft Euch Gor'teshs abgehackten Kopf.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gor'teshs abgehackter Kopf x 1",
    [3825] = "Nehmt Gor'teshs abgehackten Kopf und platziert ihn auf dem Gipfel des Schreckensfelsens. Sucht nach einem weichen Erdhügel, um den Pfahl aufzustellen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gor'teshs Kopf aufgestellt x 1",
    [3841] = "Sprecht mit Quentin in Tausend Nadeln.",
    [3842] = "Bringt 2 Elixiere der Seelenstärke zu Quentin in Tausend Nadeln.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Elixier der Seelenstärke x 2",
    [3843] = "Bringt Euer empfindliches Grimmlingflitzerei ins Hinterland und sprecht mit Agnar Tiermeister, aber beeilt Euch. Ihr habt nur eine Stunde Zeit, ihn zu finden. Dann stirbt das Jungtier in dem Ei.",
    [3844] = "Sucht in dem Tümpel nach einem Hinweis darauf, wem dieses havarierte Floß gehören könnte.",
    [3845] = "Untersucht die Gegenstände in dem Bündel und bringt sie zu ihrem Besitzer.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Großer Kompass x 1\n - Welliges Kartenpergament x 1\n - Löwenkopfschlüssel x 1",
    [3881] = "Bringt eine Kiste mit Nahrungsmitteln und Forscherausrüstung zu Williden Marschall im Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kiste mit Lebensmitteln x 1\n - Forscherausrüstung x 1",
    [3882] = "Bringt 8 Dinosaurierknochen zu Funks Nilminer im Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Dinosaurierknochen x 8",
    [3883] = "Verwendet die Kratzphiole, um damit eine Schwarmbauwandprobe von einer der Schwarmbrutstätten der Gorishi im Krater von Un'Goro zu holen. Sucht nach den Kammern mit der hängenden Larvenbrut.\n\nBringt die Schwarmbauwandprobe zu Hol'anyee Marschall im Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schwarmbauwandprobe x 1",
    [3884] = "Bringt das Tagebuch zu Williden Marschall zurück. Er befindet sich irgendwo im Krater von Un'Goro.",
    [3908] = "Bringt Linkens Schwert zu Donova Schneeweh in Winterquell.",
    [4022] = "Zeigt Cyrus Therepentous die abgestreifte Haut des schwarzen Drachenschwarms, die Ihr von Velarok Windklinge erhalten habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Abgestreifte Haut des schwarzen Drachenschwarms x 1\n - Beweis erbracht",
    [4061] = "Begebt Euch in die brennende Steppe und beschafft für Theodora Mulvadania 10 gerissene Elementarsplitter.\n\nEuch fällt ein, dass Theodora gesagt hat, die Golems und Elementare in der Gegend seien eine gute Quelle für solche Splitter.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gerissener Elementarsplitter x 10",
    [4101] = "Bringt 15 Einheiten Blutharz zu Arathandris Silberwolke im Teufelswald.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutharz x 15",
    [4102] = "Bringt 15 Einheiten Blutharz zu Maybess Flussbrise im Teufelswald.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutharz x 15",
    [4103] = "|Cffffd100Anforderungen:|r\n - Verderbter Seelensplitter x 6",
    [4120] = "Talo Dornhuf im Camp Mojache in Feralas möchte, dass Ihr 12 Wutklauengrizzlys und 12 Teufelspfotenverheerer im Teufelswald erledigt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wutklauengrizzly x 12\n - Teufelspfotenverheerer x 12",
    [4124] = "Sprecht mit Ginro Herdfeuer in der Mondfederfeste.",
    [4125] = "Sucht das Boot des Kuriers irgendwo entlang der Küste von Feralas.",
    [4127] = "Kehrt zur Mondfederfeste zurück und zeigt Ginro Herdfeuer das gefundene Messer.",
    [4129] = "Bringt Quintis Lebenshand in der Mondfederfeste das gefundene Messer.",
    [4130] = "Sprecht mit Ginro Herdfeuer in der Mondfederfeste.",
    [4131] = "Durchsucht die Lager der Waldpfotengnolle im Süden von Feralas nach Hinweisen auf den Verbleib des Kuriers oder seiner Habseligkeiten.",
    [4133] = "Sprecht mit Schattenmeisterin Vivian Lagrave in Kargath.",
    [4135] = "Da Ihr jetzt Raschals letzten bekannten Aufenthaltsort in Erfahrung gebracht habt, setzt Ihr die Suche nach ihm oder seinen sterblichen Überresten in der verwundenen Tiefe fort. Laut Notiz soll dieser Ort südlich der Lager der Waldpfotengnolle liegen.",
    [4141] = "Sammelt 15 Blutblüten und kehrt zu Muigin zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutblüte x 15",
    [4145] = "Jagt 5 Blutblütenpeitscher, 5 Blutblütendrescher, 5 Blutblütenschinder und 5 Blutblütenfallen für Larion in Marschalls Zuflucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutblütenpeitscher x 5\n - Blutblütenfalle x 5\n - Blutblütenschinder x 5\n - Blutblütendrescher x 5",
    [4147] = "Reist zu Marvon Nietensuchers Werkstatt in Ratschet.",
    [4182] = "Erschlagt 15 schwarze Brutlinge, 10 Exemplare der schwarzen Großdrachenbrut, 4 schwarze Wyrmkin und 1 Schwarzdrachen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schwarzer Brutling x 15\n - Schwarze Großdrachenbrut x 10\n - Schwarzdrache x 1\n - Schwarzwyrmkin x 4",
    [4184] = "Reist nach Sturmwind und tragt Solomons Hilfegesuch dem König Varian Wrynn vor.\n\nDer König residiert in Burg Sturmwind.",
    [4186] = "Händigt Wrynns Erlass an Magistrat Solomon in Seenhain aus.",
    [4223] = "Sprecht mit Marschall Maxwell in der brennenden Steppe.",
    [4224] = "Sprecht mit dem struppigen John.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Die Geschichte des struppigen John",
    [4243] = "Sucht im Krater von Un'Goro nach A-Me 01.",
    [4244] = "Sucht ein Mithrilgehäuse und bringt es zu A-Me 01 im Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Mithrilgehäuse x 1",
    [4245] = "Begleitet A-Me 01 zu Karna Wirrbart im Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - A-Me 01 beschützen, bis Ihr bei Karna Wirrbart angekommen seid.",
    [4261] = "Bringt Arei in Sicherheit und sprecht dann mit Kayneth Stillwind in Waldeslied, im Osten des Eschentals.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Helft Arei sich in Sicherheit zu begeben",
    [4265] = "Begleitet Raschal sicher aus dem Schwarmbau der Zukk'ash hinaus.\n\nKehrt zu Ginro Herdfeuer in der Mondfederfeste zurück und lasst ihn wissen, dass Raschal am Leben ist und dass es ihm gut geht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Befreit Raschal.",
    [4266] = "Sprecht mit Shandris Mondfeder in der Mondfederfeste.",
    [4267] = "Bringt Raschals Bericht zu Gracina Glaubensmacht in Darnassus.",
    [4281] = "Bringt das nicht ausgelieferte Paket zu Falfindel Wegeshut in Thalanaar.",
    [4283] = "Beschafft Euch 50 Medaillons des Schwarzfelsklans.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Medaillon des Schwarzfelsklans x 50",
    [4284] = "Sammelt 7 Machtkristalle von jeder Farbe: rot, blau, gelb und grün. Bringt sie zu J. D. Collie in Marschalls Zuflucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Roter Machtkristall x 7\n - Gelber Machtkristall x 7\n - Grüner Machtkristall x 7\n - Blauer Machtkristall x 7",
    [4285] = "Findet den Standort des nördlichen Kristallpylonen im Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Findet und untersucht den nördlichen Kristallpylonen.",
    [4287] = "Findet den Standort des östlichen Kristallpylonen im Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Findet und untersucht den östlichen Kristallpylonen.",
    [4288] = "Findet den Standort des westlichen Kristallpylonen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Findet und untersucht den westlichen Kristallpylonen.",
    [4289] = "Bringt Torwa Pfadfinder am Eingang zum Krater von Un'Goro 2 Gorillapelze von Un'Goro, 2 Stampferpelze von Un'Goro und 2 Donnererpelze von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gorillapelz von Un'Goro x 2\n - Stampferpelz von Un'Goro x 2\n - Donnererpelz von Un'Goro x 2",
    [4290] = "Sucht das Gerippe von Lar'korwis letzter Jagdbeute und stehlt einen Teil eines Dreschadongerippes; kehrt dann zu Torwa Pfadfinder im Krater von Un'Goro zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Teil eines Dreschadongerippes x 1",
    [4291] = "Bringt Torwa Pfadfinder in der Nähe des Eingangs zum Krater von Un'Goro 2 Pheromondrüsen eines Ravasaurus.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Pheromondrüse eines Ravasaurus x 2",
    [4292] = "Beschwört Lar'korwi mit dem Inhalt von Torwas Beutel und besiegt ihn. Bringt dann Lar'korwis Kopf zu Torwa Pfadfinder in der Nähe des Eingangs zum Krater von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Lar'korwis Kopf x 1",
    [4293] = "Sammelt im Teufelswald Proben von verschiedenen Schleimen. Verwendet dann die Testausrüstung neben Chemiker Brenner in Unterstadt, um zu sehen, welche Eurer Proben am verderbtesten sind. Bringt 5 der verderbten Proben aus dem Teufelswald, die Ihr findet, zu Chemiker Brenner.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Verderbte Probe aus dem Teufelswald x 5",
    [4294] = "Sammelt im Un'Goro Proben von verschiedenen Schleimen. Verwendet dann die Testausrüstung neben Chemiker Brenner in Unterstadt, um zu sehen, welche Eurer Proben am reinsten sind. Bringt 5 der reinen Proben aus dem Un'Goro, die Ihr findet, zu Chemiker Brenner.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Reine Probe aus dem Un'Goro x 5",
    [4296] = "Beschafft Euch die Abschrift der Schrifttafel.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schrifttafelabschrift x 1",
    [4297] = "Bringt Agnar Tiermeister im Hinterland 5 Silbermähnenpirscherflanken.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Silbermähnenpirscherflanke x 5",
    [4298] = "Sprecht mit Agnar Tiermeister im Hinterland.",
    [4300] = "Bringt Jes'rimon in Orgrimmar 8 weiße Ravasaurusklauen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Weiße Ravasaurusklaue x 8",
    [4301] = "Bringt U'chas Pelz zu Torwa Pfadfinder am Eingang des Kraters von Un'Goro.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - U'chas Pelz x 1",
    [4321] = "Sprecht demnächst mit J. D. Collie.",
    [4324] = "Sprecht mit Yuka Schraubstutz in der brennenden Steppe.",
    [4421] = "Tötet Xavathras sowie 11 Jadefeuerteufelsanbeter, 9 Jadefeuerschattenpirscher und 9 Jadefeuerschurken. Kehrt zu Eridan Blauwind im Teufelswald zurück, sobald die Aufgabe erledigt ist.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Jadefeuerteufelsanbeter x 11\n - Jadefeuerschattenpirscher x 9\n - Jadefeuerschurke x 9\n - Xavathras x 1",
    [4441] = "Begebt Euch nach Darnassus und verwendet Eridans Phiole, um Euch im Tempel des Mondes eine Phiole mit gesegnetem Wasser zu holen. Kehrt mit der gefüllten Phiole zu Eridan zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Phiole mit gesegnetem Wasser x 1",
    [4442] = "Sprecht Eridan gleich noch einmal an.",
    [4449] = "Tötet 8 Geologen der Dunkeleisenzwerge und bringt der Person, die im Plumpsklo in der sengenden Schlucht eingesperrt ist, 15 Stücke Seidenstoff.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geologe der Dunkeleisenzwerge x 8\n - Seidenstoff x 15",
    [4450] = "Nehmt die Abschrift von Goldstahls Geschäftsbuch und beschafft Euch dann die darin aufgeführten Gegenstände, ehe Ihr Krinkle Goldstahl in Tanaris aufsucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Goldstahls Geschäftsbuch x 1\n - Robuster Kristallbeinschaft x 20\n - Überfälliges Päckchen x 1\n - Goldstahls ausbalancierter Flamberg x 1",
    [4451] = "Sucht in der sengenden Schlucht, bis Ihr etwas findet, wofür man den Schlüssel für Rußschlacks Schuppen verwenden kann, den Ihr gefunden habt.",
    [4486] = "Sprecht mit Duthorian Rall in Sturmwind.",
    [4490] = "Sprecht in Ratschet mit Strahad Farsan, um zu lernen, wie man ein Teufelsross beschwört.",
    [4491] = "Führt Ringo zu Spraggel Frock in Marschalls Zuflucht.\n\nFalls Ringo ohnmächtig werden sollte, verwendet Spraggles Feldflasche, um ihn zu beleben.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Ringo zu Spraggel Frock in Marschalls Zuflucht begleiten",
    [4492] = "Sucht Ringo am Feuersäulengrat.",
    [4493] = "Sprecht in Gadgetzan mit Alchemist Stößelbruch.",
    [4494] = "Sprecht in Gadgetzan mit Alchemist Stößelbruch.",
    [4496] = "Bringt eine Gorishiduftdrüse und 5 Erdproben von Un'Goro zu Alchemist Stößelbruch in Gadgetzan.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gorishiduftdrüse x 1\n - Erde von Un'Goro x 5",
    [4501] = "Tötet 10 rasende Pterrordax und sprecht dann mit Spraggel Frock in Marschalls Zuflucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Rasender Pterrordax x 10",
    [4502] = "Sammelt 9 Proben der Asche von Un'Goro von den Feuerelementaren am Vulkan im Krater von Un'Goro ein und bringt die Proben zu Liv Ritzelflick in Ratschet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Asche von Un'Goro x 9",
    [4503] = "Sammelt 8 eingesponnene Dimetrodonschuppen und 8 eingesponnene Pterrordaxschuppen für Sappalot in Marschalls Zuflucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Eingesponnene Dimetrodonschuppe x 8\n - Eingesponnene Pterrordaxschuppe x 8",
    [4504] = "Sammelt 12 Proben superklebrigen Teer für Tran'rek in Gadgetzan.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Superklebriger Teer x 12",
    [4505] = "Beschafft eine Probe verderbten Wassers vom Mondbrunnen der Jadefeuersatyrn und bringt sie zu Winna Hazzard am Blutgiftposten.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gefülltes Fläschlein x 1",
    [4506] = "Bringt Winnas Kätzchen zum verderbten Mondbrunnen, lasst es dort frei und bringt es dann wieder zu Winna zurück.\n\nSobald Ihr wieder bei Winna seid, klickt auf die Katze, um sie Winna zu übergeben.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Bringt die verderbte Katze zu Winna Hazzard zurück",
    [4512] = "Bringt 6 mit verfluchtem Schlamm gefüllte Gläser und 6 mit besudeltem Schlamm gefüllte Gläser zu Laris Bummelritzel in Eisenschmiede.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Mit verfluchtem Schlamm gefülltes Glas x 6\n - Mit besudeltem Schlamm gefülltes Glas x 6",
    [4513] = "Bringt 10 gefüllte reine Probengläser zu Laris Bummelritzel in Eisenschmiede.\n\nFalls Ihr Probleme habt, fündig zu werden, dann kann Laris Euch vielleicht noch den einen oder anderen Hinweis geben.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Mit einer reinen Probe gefülltes Glas x 10",
    [4521] = "Trull Scheiterbann im Teufelswald möchte, dass Ihr 15 tobende Eulenbestien und 15 struppige Eulenbestien tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Tobende Eulenbestie x 15\n - Struppige Eulenbestie x 15",
    [4642] = "Bringt eine Probe verschmolzenem Schlamms zum Chemiker Brenner in Unterstadt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Probe verschmolzenem Schlamms x 1",
    [4721] = "Trull Scheiterbann im Teufelswald möchte, dass Ihr in Winterquell 10 Berserkereulenbestien jagt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Berserkereulenbestie x 10",
    [4726] = "Bringt 8 Brutlingessenzen sowie den Draco-Incarcinatrix 900 zu Tinkee Kesseldampf auf dem Flammenkamm in der brennenden Steppe.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Brutlingessenz x 8",
    [4738] = "Sprecht im Brachland mit Menara Leerbringer.",
    [4741] = "Trull Scheiterbann im Teufelswald möchte, dass Ihr in Winterquell 13 mondbestrahlte Eulenbestien jagt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Mondbestrahlte Eulenbestie x 13",
    [4781] = "Bringt Xizk Gutstich im Schlingendorntal einen Goldbarren.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Goldbarren x 1",
    [4782] = "Kehrt zu Menara Leerbringer im Brachland zurück.",
    [4783] = "Bringt Menara Leerbringer im Brachland 10 Phiolen Zornsäerblut und 1 geringen Höllenstein.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Phiole mit Zornsäerblut x 10\n - Geringer Höllenstein x 1",
    [4784] = "Bringt Menara Leerbringer im Brachland feinen Goldfaden, 2 glimmende Kohlen und einen Seelensplitter.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Feiner Goldfaden x 1\n - Glimmende Kohle x 2\n - Seelensplitter x 1",
    [4786] = "Wartet, bis Menara Leerbringer Eure Robe fertiggestellt hat, und sprecht dann noch einmal mit ihr.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wartet, bis Menara Leerbringer Euren Gegenstand fertiggestellt hat.",
    [4808] = "Gebt Felnok Stahlfeder in der Ewigen Warte in Winterquell Tinkees Brief.",
    [4809] = "Beschafft Euch 8 unbeschädigte Hörner.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Unbeschädigtes Horn einer Eiswindschimäre x 8",
    [4810] = "Bringt Tinkee Kesseldampf auf dem Flammenkamm in der brennenden Steppe Felnoks Päckchen.",
    [4842] = "Befolgt Donova Schneewehs Anweisungen und meldet Euch dann wieder bei ihr.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Erkundung der flüsternden Schlucht",
    [4861] = "Findet Jaron Steinschleifers ruiniertes Lager samt dessen Vorräten im südlichen Winterquell.",
    [4863] = "Sucht Jaron Steinschleifers zerstörten Wagen.",
    [4864] = "Klaubt Jarons Ladung aus dem Schnee und sucht dann die Wildekin, die das Amulett gestohlen haben, von dem Jaron gesprochen hatte.\n\nBringt Jaron Steinschleifer in der Lodge in Winterquell dessen Ladung und das blaugefiederte Amulett.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Jarons Ladung x 1\n - Blaugefiedertes Amulett x 1",
    [4882] = "Bringt Trull Scheiterbann beim Blutgiftposten das blaugefiederte Amulett.",
    [4883] = "Bringt Nara Wildmähne das blaugefiederte Amulett.",
    [4901] = "Schützt Ranshalla, während sie versucht, den Altar von Elune wieder zu aktivieren. Berichtet Erelas Himmelsbern in Rut'theran von Eurem Fund.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Entdeckt das Geheimnis des Altars von Elune.",
    [4902] = "Sprecht mit Erzdruide Fandral Hirschhaupt in Darnassus.",
    [4906] = "Eridan Blauwind im Teufelswald möchte, dass Ihr Xavaric sowie 8 Jadefeuerhöllenrufer, 8 Jadefeuerverräter und 8 Jadefeuerschwindler tötet. Kehrt zu Eridan zurück, sobald Ihr die Aufgabe erfüllt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Jadefeuerhöllenrufer x 8\n - Jadefeuerverräter x 8\n - Jadefeuerschwindler x 8\n - Xavaric x 1",
    [4961] = "Tötet den Dämon der Kugel und sprecht dann mit Tabetha.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Dämon der Kugel x 1",
    [4962] = "Nehmt den Teufelsrubin und benutzt ihn bei einem der Teufelshunde von Desolace. Wenn Ihr Erfolg hattet, bringt Menara Leerbringer im Brachland den eingekerkerten Teufelshundgeist und den Teufelsrubin.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Eingekerkerter Teufelshundgeist x 1",
    [4963] = "Nehmt den Infussmaragd und benutzt ihn bei einer der Höllenbestien von Desolace. Wenn Ihr Erfolg hattet, bringt Menara Leerbringer im Brachland den eingekerkerten Höllenbestiengeist und den Infussmaragd.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Eingekerkerter Höllenbestiengeist x 1",
    [4964] = "Wartet, bis Menara Leerbringer die Kugel von Dar'Orahil fertig gestellt hat, und sprecht dann noch einmal mit ihr.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wartet, bis Menara Leerbringer Euren Gegenstand fertiggestellt hat.",
    [4965] = "Sprecht mit Menara Leerbringer im Brachland.",
    [4969] = "Sprecht mit Menara Leerbringer im Brachland.",
    [4970] = "Sammelt 5 Splitterzahnfleischstücke und 5 Fleischstücke einer Eiswindschimäre für Rivern Frostwind in Winterquell.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Splitterzahnfleisch x 5\n - Fleisch einer Eiswindschimäre x 5",
    [4971] = "Benutzt den Temporalversetzer in der Nähe eines der Silos von Andorhal, um die temporalen Parasiten aufzuspüren.\n\nTötet 10 temporale Parasiten und bringt dann den Temporalversetzer zu Chromie im Gasthaus Andorhal in den westlichen Pestländern.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Temporaler Parasit x 10",
    [4972] = "Sucht 5 Uhren von Andorhal, die in Schließkassetten überall im Schutt der Stadt zu finden sind. Kehrt mit ihnen zu Chromie ins Gasthaus Andorhal in den westlichen Pestländern zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Uhr von Andorhal x 5",
    [4976] = "Bringt die gesäuberte Höllenkugel zu Menara Leerbringer ins Brachland.",
    [4984] = "Tötet 8 kranke Wölfe und kehrt dann zu Mulgris Tiefenfurt auf dem trostlosen Feld in den westlichen Pestländern zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kranker Wolf x 8",
    [4985] = "Tötet 8 kranke Grizzlys und kehrt dann zu Mulgris Tiefenfurt auf dem trostlosen Feld in den westlichen Pestländern zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kranker Grizzly x 8",
    [4986] = "Nach der Magie zu urteilen, mit der der glyphenverzierte Eichenast erfüllt ist, hatte der Taurendruide wohl gewollt, dass Ihr den Ast zum Zirkel des Cenarius nach Darnassus bringt. Bittet einen der Druiden dort um Hilfe.",
    [4987] = "Nach der Magie zu urteilen, mit der der glyphenverzierte Eichenast erfüllt ist, hatte der Taurendruide wohl gewollt, dass Ihr den Ast zum Zirkel des Cenarius nach Donnerfels bringt. Bittet einen der Druiden dort um Hilfe.",
    [5021] = "Das wilde Gebrabbel der Geisterfrau deutete darauf hin, dass sie ein Paket ausliefern musste. Sie behauptete, dass es dort war, wo auch ihr Pferd war. Darüber, wo das Pferd jetzt ist oder wohin das Paket ausgeliefert werden muss, sagt der Geist nichts.",
    [5022] = "Wendet Euch an die königlichen Disponenten von Sturmwind, um etwas über den Aufenthaltsort von Emma Teufelsstein herauszufinden. Normalerweise findet sich ein Volkszählungsbeamter im Rathaus.",
    [5023] = "Wendet Euch an die königlichen Vorarbeiter von Unterstadt, um etwas über den Aufenthaltsort von Jeremiah Teufelsstein herauszufinden. Normalerweise findet sich ein Volkszählungsbeamter in der Nähe der Gilden- und Wappenrock-Registrierung.",
    [5048] = "Sucht die alte Emma in Sturmwind und findet heraus, ob sie tatsächlich Emma Teufelsstein ist. Wenn sie es ist, dann möchte sie vielleicht das Paket haben, das Janice Teufelsstein für sie gepackt hat.",
    [5049] = "Sucht Jeremiah Payson in Unterstadt und findet heraus, ob er tatsächlich Jeremiah Teufelsstein ist. Wenn er es ist, dann möchte er vielleicht das Paket haben, das Janice Teufelsstein für ihn gepackt hat.",
    [5050] = "Bringt Janice Teufelsstein in den westlichen Pestländern die Hälfte ihres Glücksbringers zurück.",
    [5051] = "Sucht auf dem Teufelssteinfeld in den westlichen Pestländern nach der anderen Hälfte des Glücksbringers und setzt ihn wieder zusammen.\n\nGebt den Glücksbringer Janice Teufelsstein auf dem Teufelssteinfeld in den westlichen Pestländern.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Glücksbringer x 1",
    [5054] = "Storm Schattenhuf in der Ewigen Warte in Winterquell möchte, dass Ihr Ursius tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Ursius x 1",
    [5055] = "Storm Schattenhuf in der Ewigen Warte in Winterquell möchte, dass Ihr Brumeran tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Brumeran x 1",
    [5060] = "|Cffffd100Anforderungen:|r\n - Dalsons Schrankschlüssel x 1",
    [5066] = "Sucht Kommandant Ashlam Ehrenschlag auf. Sein Stützpunkt befindet sich am Zugwindlager, nördlich des Alteracgebirges.",
    [5082] = "Donova Schneeweh in Winterquell möchte, dass Ihr 8 Pfadfinder der Winterfelle, 8 Höhlenbehüter der Winterfelle und 8 Totemiker der Winterfelle erledigt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Pfadfinder der Winterfelle x 8\n - Höhlenbehüter der Winterfelle x 8\n - Totemiker der Winterfelle x 8",
    [5083] = "Bringt das leere Feuerwasserfläschchen zu Donova Schneeweh in Winterquell.",
    [5084] = "Durchsucht das Furbolglager der Totenwaldfelle im nördlichen Teil des Teufelswalds nach einem Hinweis.",
    [5085] = "Berichtet Donova Schneeweh von Euren Entdeckungen.",
    [5086] = "Sammelt 3 Toxinschreckentropfen für Donova Schneeweh in Winterquell.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Toxinschreckentropfen x 3",
    [5087] = "Sucht die Läufer der Winterfelle und hindert sie daran, ihre Lieferung zum Lager der Winterfelle zu bringen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kiste der Winterfelle x 1",
    [5090] = "Sucht Kommandant Ashlam Ehrenschlag auf. Sein Stützpunkt befindet sich am Zugwindlager, nördlich des Alteracgebirges.",
    [5091] = "Sucht Kommandant Ashlam Ehrenschlag auf. Sein Stützpunkt befindet sich am Zugwindlager, nördlich des Alteracgebirges.",
    [5092] = "Tötet 10 Skelettschinder und 10 sabbernde Ghuls in Trauerhügel.\n\nKehrt zu Kommandant Ashlam Ehrenschlag am Zugwindlager, westliche Pestländer, zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Skelettschinder x 10\n - Sabbernder Ghul x 10",
    [5093] = "Sucht Hochexekutor Derrington auf. Sein Stützpunk befindet sich am Bollwerk, östlich von Tirisfal und Unterstadt.",
    [5094] = "Sucht Hochexekutor Derrington auf. Sein Stützpunk befindet sich am Bollwerk, östlich von Tirisfal und Unterstadt.",
    [5095] = "Sucht Hochexekutor Derrington auf. Sein Stützpunkt befindet sich am Bollwerk, östlich von Tirisfal und Unterstadt.",
    [5096] = "Zieht zum Basislager des Scharlachroten Kreuzzugs zwischen dem Teufelssteinfeld und Dalsons Tränenfeld und zerstört sein Kommandozelt.\n\nLasst das Banner der Geißel im Lager wehen und kehrt dann zu Hochexekutor Derrington am Bollwerk in den westlichen Pestländern zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Zerstört das Kommandozelt und hisst das Banner der Geißel im Lager.",
    [5097] = "Markiert mit der Signalfackel jeden Turm in Andorhal; Ihr müsst im Eingang jedes Turmes stehen, um ihn erfolgreich zu markieren.\n\nWenn alle vier Türme markiert sind, bringt Ihr die Signalfackel zu Kommandant Ashlam Ehrenschlag am Zugwindlager, westliche Pestländer, zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Turm eins markiert x 1\n - Turm zwei markiert x 1\n - Turm drei markiert x 1\n - Turm vier markiert x 1",
    [5098] = "Markiert mit der Signalfackel jeden Turm in Andorhal; Ihr müsst im Eingang jedes Turmes stehen, um ihn erfolgreich zu markieren.\n\nWenn alle vier Türme markiert sind, bringt Ihr die Signalfackel zu Hochexekutor Derrington am Bollwerk, westliche Pestländer, zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Turm eins markiert x 1\n - Turm zwei markiert x 1\n - Turm drei markiert x 1\n - Turm vier markiert x 1",
    [5121] = "Donova Schneeweh in Winterquell möchte, dass Ihr den Oberhäuptling der Winterfelle besiegt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Oberhäuptling der Winterfelle x 1",
    [5149] = "Sucht Pamelas Puppe.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Pamelas Puppe x 1",
    [5152] = "Sprecht mit Marlene, südlich der Ruinen von Andorhal.",
    [5153] = "Bringt Josephs Ehering zu Chromie.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Josephs Ehering x 1",
    [5154] = "Bringt die 'Annalen von Darroheim' zu Chromie in Andorhal.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Annalen von Darroheim x 1",
    [5155] = "Betretet Jaedenar und erschlagt 4 Hunde von Jaedenar, 4 Gardisten von Jaedenar, 6 Adepten von Jaedenar und 6 Kultisten von Jaedenar, bevor Ihr zu Greta Mooshuf im Teufelswald zurückkehrt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hund von Jaedenar x 4\n - Wächter von Jaedenar x 4\n - Adept von Jaedenar x 6\n - Kultist von Jaedenar x 6",
    [5156] = "Sucht und zerstört 2 entropische Bestien und 2 entropische Schrecken, während Ihr den Narbengrund erforscht. Nachdem Ihr überprüft habt, ob die Krater immer noch mit verderbtem Wasser gefüllt sind, kehrt zu Taronn Rotfeder im Teufelswald zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Entropische Bestie x 2\n - Entropischer Schrecken x 2\n - Untersucht die Krater im Narbengrund.",
    [5157] = "Bringt die leere Feldflasche zum Mondbrunnen im Zentrum von Jaedenar und füllt sie, bevor Ihr zu Greta Mooshuf im Teufelswald zurückkehrt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Verderbtes Mondbrunnenwasser x 1",
    [5158] = "Bringt das verderbte Mondbrunnenwasser in das Brachland zu Islen Wasserdeuter.",
    [5159] = "Bringt das geläuterte Mondbrunnenwasser zu Greta Mooshuf im Teufelswald.",
    [5163] = "Nehmt Umis mechanischen Yeti und erschreckt ihre Freunde damit:\n\nLegacki in der Ewigen Warte (Winterquell)\nSprinkel in Gadgetzan (Tanaris)\nQuixxil in Marschalls Zuflucht (Krater von Un'Goro)\n\nWenn Ihr damit fertig seid, bringt den mechanischen Yeti zu Umi zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Legacki erschrecken x 1\n - Sprinkle erschrecken x 1\n - Quixxil erschrecken x 1",
    [5165] = "Übergießt die Flammen der vier Kohlenpfannen des Schutzes in der Schattenfeste im Teufelswald mit dem geläuterten Mondbrunnenwasser und kehrt danach zu Greta Mooshuf im Smaragdrefugium zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Löscht die Kohlenpfanne des Schmerzes x 1\n - Löscht die Kohlenpfanne der Bosheit x 1\n - Löscht die Kohlenpfanne des Leidens x 1\n - Löscht die Kohlenpfanne des Hasses x 1",
    [5181] = "Bringt den Schädel von Horgus und das zertrümmerte Schwert von Marduk zu Carlin Rotpfad in der Kapelle des hoffnungsvollen Lichts.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schädel von Horgus x 1\n - Zertrümmertes Schwert von Marduk x 1",
    [5210] = "Bringt die erweiterten 'Annalen von Darroheim' zu Carlin Rotpfad in den östlichen Pestländern.",
    [5211] = "Befreit 15 Geister von Darroheim und kehrt dann zu Carlin Rotpfad zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geister von Darrowheim befreit x 15",
    [5215] = "Sprecht mit der Hohepriesterin MacDonnell an der Zugwindspitze, westliche Pestländer.",
    [5216] = "Geht zum Teufelssteinfeld in den westlichen Pestländern. Sucht nach dem dortigen Kessellord und besiegt ihn. Er könnte einen Schlüssel haben, der den Zugang zu dem Kessel ermöglicht. Ihr müsst die leere Flasche: Teufelssteinfeld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Teufelssteinfeld x 1",
    [5217] = "Bringt die gefüllte Flasche: Teufelssteinfeld zur Hohepriesterin MacDonnell am Zugwindlager, westliche Pestländer.",
    [5219] = "Begebt Euch zu Dalsons Tränenfeld in den westlichen Pestländern, um den dortigen Kessellord zu suchen und zu besiegen. Verwendet dann seinen Schlüssel, um Zugang zum Kessel zu erhalten. Ihr müsst die leere Flasche: Dalsons Tränenfeld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Dalsons Tränenfeld x 1",
    [5220] = "Bringt die gefüllte Flasche: Dalsons Tränenfeld zur Hohepriesterin MacDonnell am Zugwindlager, westliche Pestländer.",
    [5222] = "Begebt Euch zum trostlosen Feld in den westlichen Pestländern, um den dortigen Kessellord zu suchen und zu besiegen. Verwendet dann seinen Schlüssel, um Zugang zum Kessel zu erhalten. Ihr müsst die leere Flasche: Das trostlose Feld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Das trostlose Feld x 1",
    [5223] = "Bringt die gefüllte Flasche: Das trostlose Feld zur Hohepriesterin MacDonnell am Zugwindlager, westliche Pestländer.",
    [5225] = "Begebt Euch zu Gahrrons Trauerfeld in den westlichen Pestländern, um den dortigen Kessellord zu suchen und zu besiegen. Verwendet dann seinen Schlüssel, um Zugang zum Kessel zu erhalten. Ihr müsst die leere Flasche: Gahrrons Trauerfeld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Gahrrons Trauerfeld x 1",
    [5226] = "Bringt die gefüllte Flasche: Gahrrons Trauerfeld zur Hohepriesterin MacDonnell am Zugwindlager, westliche Pestländer.",
    [5228] = "Sprecht mit der Schattenpriesterin Vandis am Bollwerk, westliche Pestländer.",
    [5229] = "Geht zum Teufelssteinfeld in den westlichen Pestländern. Sucht nach dem dortigen Kessellord und besiegt ihn. Er könnte einen Schlüssel haben, der den Zugang zu dem Kessel ermöglicht. Ihr müsst die leere Flasche: Teufelssteinfeld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Teufelssteinfeld x 1",
