    [5231] = "Begebt Euch zu Dalsons Tränenfeld in den westlichen Pestländern, um den dortigen Kessellord zu suchen und zu besiegen. Verwendet dann seinen Schlüssel, um Zugang zum Kessel zu erhalten. Ihr müsst die leere Flasche: Dalsons Tränenfeld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Dalsons Tränenfeld x 1",
