    [5233] = "Begebt Euch zum trostlosen Feld in den westlichen Pestländern, um den dortigen Kessellord zu suchen und zu besiegen. Verwendet dann seinen Schlüssel, um Zugang zum Kessel zu erhalten. Ihr müsst die leere Flasche: Das trostlose Feld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Das trostlose Feld x 1",
    [5234] = "Bringt die gefüllte Flasche: Das trostlose Feld zur Schattenpriesterin Vandis am Bollwerk, westliche Pestländer.",
    [5235] = "Begebt Euch zu Gahrrons Trauerfeld in den westlichen Pestländern, um den dortigen Kessellord zu suchen und zu besiegen. Verwendet dann seinen Schlüssel, um Zugang zum Kessel zu erhalten. Ihr müsst die leere Flasche: Gahrrons Trauerfeld bei Euch haben, um eine Probe des Giftes zu entnehmen, das sich in dem Kessel findet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kesselschlüssel: Gahrrons Trauerfeld x 1",
    [5236] = "Bringt die gefüllte Flasche: Gahrrons Trauerfeld zur Schattenpriesterin Vandis am Bollwerk, westliche Pestländer.",
    [5241] = "Sucht Carlin Rotpfad.",
    [5242] = "Tötet Moora und Salia und bringt den Kopf von Schattenlord Fel'dan zu Greta Mooshuf im Teufelswald.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Moora x 1\n - Salia x 1\n - Schattenlord Fel'dans Kopf x 1",
    [5244] = "Sprecht mit Jaron Steinschleifer in Sternfall.",
    [5245] = "Benutzt Jarons Hacke, um die vier Fragmente des Hochgeborenenrelikts zu suchen. Bringt sie zu Aurora Himmelsrufer in den östlichen Pestländern.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Erstes Reliktfragment x 1\n - Zweites Reliktfragment x 1\n - Drittes Reliktfragment x 1\n - Viertes Reliktfragment x 1",
    [5246] = "Sucht die hochheiligen Schriften der Hochgeborenen im Tempel von Zin-Malor in Azshara und bringt sie zu Aurora Himmelsrufer beim Nordpassturm in den östlichen Pestländern.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hochheilige Schriften der Hochgeborenen x 1",
    [5249] = "Sucht Sternfall in Winterquell und sprecht mit Wynd Nachtjagd.",
    [5250] = "Sucht die Siedlung Sternfall in Winterquell und sprecht mit Wynd Nachtjagd.",
    [5281] = "Sucht Egan. Ihr wisst nur, dass er zuletzt in der Nähe von Stratholme gesehen wurde.",
    [5361] = "Bringt den Bericht von Klippenbehüter Langhorn zu Nataka Langhorn am Geistwandlerposten in Desolace.",
    [5381] = "Holt den Dämonenkasten aus der Festung Donneraxt und kehrt damit zu Taiga Klugmähne nach Schattenflucht zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Dämonenkasten x 1",
    [5386] = "Sprecht mit Jinar'Zillen in Schattenflucht und bringt Nataka Langhorn dann 2 Blutbauchfische.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutbauchfisch x 2",
    [5421] = "|Cffffd100Anforderungen:|r\n - Schalentier x 5",
    [5501] = "Bringt Bibbly F'utzbuckel bei Kormeks Hütte 10 Kodoknochen vom Kodofriedhof.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kodoknochen x 10",
    [5510] = "|Cffffd100Anforderungen:|r\n - Geißelstein des Dieners x 20",
    [5527] = "Reist nach Silithus und sucht in den Ruinen des Südwindpostens nach einem Reliquiar der Reinheit. Sollte Eure Suche Erfolg haben, kehrt zu Rabine Saturna in Nachthafen auf der Mondlichtung zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Reliquiar der Reinheit x 1",
    [5533] = "Sprecht mit Alchemist Arbington an der Zugwindspitze, westliche Pestländer.",
    [5534] = "Sucht, in den Ruinen von Eldarath irgendeine Rune, die die Naga in ihrem Besitz haben, und bringt sie Kim'jael in Azshara.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Beliebige Rune x 1",
    [5535] = "Vernichtet 6 Erscheinungen einer Hochgeborenen und 6 Lichlinge eines Hochgeborenen, bevor Ihr zu Loh'atu in Azshara zurückkehrt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Erscheinung einer Hochgeborenen x 6\n - Lichling eines Hochgeborenen x 6",
    [5536] = "Tötet 6 Satyrn der Haldarr, 2 Schwindler der Haldarr sowie 2 Teufelsanbeter der Haldarr und kehrt dann zu Loh'atu an der Grenze zum Eschental zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Satyr der Haldarr x 6\n - Schwindler der Haldarr x 2\n - Teufelsanbeter der Haldarr x 2",
    [5537] = "Bringt 15 Skelettfragmente zu Alchemist Arbington an der Zugwindspitze, westliche Pestländer.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Skelettfragmente x 15",
    [5542] = "Erschlagt 20 kleine Seuchenhunde, 5 Seuchenhunde und 5 rasende Seuchenhunde. Kehrt zu Tirion Fordring zurück, sobald Ihr die Aufgabe erfüllt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kleiner Seuchenhund x 20\n - Seuchenhund x 5\n - Rasender Seuchenhund x 5",
    [5543] = "Erschlagt 30 Seuchenfledermäuse und kehrt zu Tirion Fordring zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Seuchenfledermaus x 30",
    [5544] = "Sucht nach den Aaslarven und Aasverschlingern dieses Gebiets. Erschlagt sie und sammelt ihr Fleisch. Kehrt zu Tirion Fordring zurück, wenn Ihr 15 Scheiben Aaswurmfleisch gesammelt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Scheibe Aaswurmfleisch x 15",
    [5581] = "Verbannt 6 Portale beim Zirkel der Mannoroc und kehrt dann zu Taiga Klugmähne nach Schattenflucht zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Verbannte Portale x 6",
    [5601] = "Sucht Pamela Rotpfad in Darroheim.",
    [5655] = "Sprecht mit Ur'kyo in Orgrimmar.",
    [5742] = "Hört Euch an, was Tirion Fordring zu sagen hat.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Tirions Geschichte",
    [5781] = "Begebt Euch zum Tiefgewölbe im südlichsten Abschnitt der östlichen Pestländer und sucht nach Taelans Hammer. Kehrt zu Tirion Fordring zurück, sobald Ihr Eure Mission abgeschlossen habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Taelans Hammer x 1",
    [5845] = "Reist ins Nordtal im nordöstlichsten Gebiet der östlichen Pestländer und sucht nach dem Symbol der verlorenen Ehre. Kehrt zu Tirion Fordring zurück, sobald Ihr Eure Mission abgeschlossen habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Symbol der verlorenen Ehre x 1",
    [5846] = "Begebt Euch zur Insel Darrowehr im südlich-zentralen Bereich der Pestländer und sucht nach Hinweisen, wo sich das Gemälde befinden könnte.",
    [5863] = "Andi Lynn in Gadgetzan möchte, dass Ihr das Truppenlager der Dünenbrecher vernichtet, indem Ihr 10 Schläger der Dünenbrecher 10 Vollstrecker der Dünenbrecher sowie Gor'marok den Verheerer tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schläger der Dünenbrecher x 10\n - Vollstrecker der Dünenbrecher x 10\n - Gor'marok der Verheerer x 1",
    [5882] = "|Cffffd100Anforderungen:|r\n - Verderbter Seelensplitter x 6",
    [5901] = "Wendet den leeren Termitenkrug auf die Termitenhügel in den östlichen Pestländern an. Sobald Ihr 100 Pestlandtermiten gesammelt habt, kehrt zu Mickey Levine am Bollwerk in Tirisfal zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Pestlandtermiten x 100",
    [5902] = "Sucht Euch einen geeigneten Ort in der Mitte des Sägewerk des Nordkamms in den westlichen Pestländern, um das Fass mit den Pestlandtermiten abzustellen.",
    [5903] = "Wendet den leeren Termitenkrug auf die Termitenhügel in den östlichen Pestländern an. Sobald Ihr 100 Pestlandtermiten gesammelt habt, kehrt zu Nathaniel Dumah im Zugwindlager in den westlichen Pestländern zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Pestlandtermiten x 100",
    [5904] = "Sucht Euch einen geeigneten Ort in der Mitte des Sägewerk des Nordkamms in den westlichen Pestländern, um das Fass mit den Pestlandtermiten abzustellen.",
    [5943] = "Geleitet Gizeltons Karawane am Zirkel der Mannoroc vorbei. Sprecht in Schraubenbuddels Lager mit Smeed, um Eure Belohnung zu erhalten.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geleitet Gizeltons Karawane am Zirkel der Mannoroc vorbei.",
    [6004] = "Tötet 2 Scharlachrote Sanitäter, 2 Scharlachrote Jäger, 2 Scharlachrote Magier und 2 Scharlachrote Ritter, bevor Ihr zu Kirsta Grubenschatten in den westlichen Pestländern zurückkehrt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Scharlachroter Sanitäter x 2\n - Scharlachroter Jäger x 2\n - Scharlachroter Magier x 2\n - Scharlachroter Ritter x 2",
    [6021] = "Bringt Zaeldarrs Kopf zu Verwalter Alen in der Kapelle des hoffnungsvollen Lichts.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Zaeldarrs Kopf x 1",
    [6022] = "Begebt Euch zu Corins Kreuzung im Osten und besiegt die Mitglieder der Geißel, die in der Stadt leben. Sammelt 7 Stücke lebendige Fäulnis in unter 10 Minuten. Zerstoßt die lebendige Fäulnis mit Mörser und Stößel zu geronnener Fäulnis.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geronnene Fäulnis x 1",
    [6023] = "Besiegt Jägerin Radley und Dragoner Durgen, bevor Ihr zu Kirsta Grubenschatten in den westlichen Pestländern zurückkehrt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Jägerin Radley x 1\n - Dragoner Durgen x 1",
    [6024] = "Tötet Spitzel Hameya. Benutzt seinen Schlüssel bei dem Erdhaufen hinter dem Tiefgewölbe.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hameyas Schlüssel x 1",
    [6025] = "Geht nach Herdweiler, sucht einen hohen Aussichtspunkt, von dem aus Ihr die Stadt überblicken könnt, schätzt die Streitkräfte des Scharlachroten Kreuzzugs und kehrt dann zu Kirsta Grubenschatten in den westlichen Pestländern zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schaut von einem hohen Aussichtspunkt nach Herdweiler hinein.",
    [6026] = "Smokey LaRue möchte, dass Ihr 2 Thoriumbarren, 1 Goldrute, 8 hochexplosive Bomben und 8 instabile Auslöser beschafft.\n\nFür diese Gegenstände müsst Ihr einen Schmied und einen Ingenieur finden.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Thoriumbarren x 2\n - Goldrute x 1\n - Hochexplosive Bombe x 8\n - Instabiler Auslöser x 8",
    [6027] = "Beschafft das 'Buch der Uralten' und kehrt zu Azore Aldamort im Turm von Ethel Rethor zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Buch der Uralten x 1",
    [6028] = "Bringt den Bericht der Ewigen Warte zu Argentumoffizier Reinherz im Zugwindlager in den westlichen Pestländern.",
    [6029] = "Bringt den Bericht der Ewigen Warte zu Argentumoffizier Garush im Bollwerk in den westlichen Pestländern.",
    [6030] = "Bringt das Buch 'Studien über das Geistsprechen' zu Fürst Nicholas Zverenhoff in der Kapelle des hoffnungsvollen Lichts in den östlichen Pestländern.",
    [6041] = "Reist in den Pestwald, nordwestlich der Kapelle des hoffnungsvollen Lichts. Zerstört 8 Geißelbauwerke, indem Ihr Smokeys spezielles Präparat am Mal der Zerstörung in jedem Bauwerk benutzt. Smokey hat die Ziggurats und Schlachthäuser markieren lassen.\n\nWenn ihr die Bombe gelegt habt, dann verlasst das Bauwerk und staunt über Euer Geschick.\n\nÜbrigens, Smokeys spezielles Präparat ist recht...instabil.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geißelbauwerke zerstört x 8",
    [6042] = "Erschlagt 20 giftige Seuchenfledermäuse und 10 monströse Seuchenfledermäuse. Kehrt zu Nathanos Pestrufer zurück, wenn Ihr fertig seid.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Giftige Seuchenfledermaus x 20\n - Monströse Seuchenfledermaus x 10",
    [6133] = "Begebt Euch zur nördlichsten Grenze der östlichen Pestländer und bringt die Registratur von Quel'Thalas zurück. Der Gegenstand befindet sich irgendwo in der Jagdhütte von Quel'Lithien.\n\nAußerdem müsst Ihr 8 Waldläufer, 8 Pfadschreiter und 8 Waldarbeiter töten.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Pfadwanderer x 8\n - Waldläufer x 8\n - Waldhirte x 8\n - Registratur von Quel'Thalas x 1",
    [6134] = "Bringt 8 Einheiten Geisterplasma und die Kiste mit den Geistermagneten zu Hornizz Brummsumms in Desolace.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geisterplasma x 8",
    [6135] = "Sucht Dämmerschwinge und tötet ihn. Nehmt ein Büschel vom Fell Dämmerschwinges und bringt es zu Nathanos Pestrufer.\n\nMan sagt, dass Dämmerschwinge nördlich von hier durch das Land streift.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Fellflicken von Dämmerschwinge x 1",
    [6136] = "Sucht in den nördlichen Wüsten der östlichen Pestländer nach Blutschlinger und vernichtet ihn. Kehrt zu Nathanos Pestrufer zurück, sobald Ihr diese Mission erledigt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutschlinger x 1",
    [6141] = "Sprecht mit Bruder Anton in Nijelspitze in Desolace.",
    [6142] = "Sucht 10 Teile Fleisch der weichschaligen Muschel und bringt sie zu Mai'Lahii im Dorf Schattenflucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Weichschaliges Muschelfleisch x 10",
    [6143] = "Tötet 7 Myrmidonen der Zackenkämme, 7 Naga der Zackenkämme und 5 Zauberinnen der Zackenkämme, dann sprecht in Desolace mit Drulzegar in Schattenflucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Myrmidone der Zackenkämme x 7\n - Naga der Zackenkämme x 7\n - Zauberin der Zackenkämme x 5",
    [6162] = "Tötet Oberanführer Ror und bringt seine Klaue zu Dreka'Sur beim Blutgiftposten im Teufelswald.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Klaue von Oberanführer Ror x 1",
    [6164] = "Beschafft Euch Augustus' Quittungsbuch aus dem Gasthaus im Schreckenstal.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Augustus' Quittungsbuch x 1",
    [6182] = "Sprecht mit Meister Mathias Shaw in der Altstadt von Sturmwind. Er wohnt in der Kaserne.",
    [6183] = "Sprecht wieder mit Mathias Shaw, wenn Ihr seine Aufgabe annehmen wollt.",
    [6184] = "Reist zum Zugwindlager in den westlichen Pestländern und trefft Euren Kontaktmann Flint Schattenmoor.",
    [6185] = "Sucht in den östlichen Pestländern nach Hinweisen auf den 'Pestrufer' und die vermissten SI:7-Agenten. Wenn Ihr SI:7-Insignien findet, bringt sie zu Flint Schattenmoor am Zugwindlager.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - SI:7-Insigne (Rutger) x 1\n - SI:7-Insigne (Fredo) x 1\n - SI:7-Insigne (Turyen) x 1\n - Pestrufer wird enttarnt",
    [6186] = "Kehrt nach Sturmwind zurück und informiert König Varian Wrynn über das Schicksal von Nathanos Marris.",
    [6187] = "Stellt eine Armee auf und reist zu den östlichen Pestländern. Beginnt einen gnadenlosen Angriff auf Nathanos Pestrufer und jeden Abschaum der Horde, der ihn beschützen mag.\n\nBewahrt einen klaren Kopf, Tomcatdk. Die Horde wird den Waldläuferlord mit dem Leben verteidigen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Nathanos Pestrufer x 1",
    [6389] = "Befreit die Pestlandtermiten im Sägewerk des Nordkamms, dann kehrt mit dem Fass Pestlandtermiten zu Nathaniel Dumah im Zugwindlager in den westlichen Pestländern zurück.",
    [6390] = "Befreit die Pestlandtermiten im Sägewerk des Nordkamms, dann kehrt mit dem Fass Pestländer-Termiten zu Mickey Levine im Bollwerk in Tirisfal zurück.",
    [6622] = "Rettet Patienten, indem Ihr deren Wunden mit Triagenverbänden versorgt. Ihr müsst 15 Patienten retten, bevor 6 von ihnen ihren Verletzungen erliegen.\n\nDenkt an die Einhaltung der Reihenfolge! Schwerstverletzte Soldaten sterben am schnellsten, dann die schwer verletzten Soldaten. Bei verletzten Soldaten dauert es etwas länger, bis sie sterben. Ihr solltet sie retten, NACHDEM Ihr die schwerstverletzten und schwer verletzten Soldaten selektiert habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - 15 Patienten gerettet!",
    [6624] = "Rettet Patienten, indem Ihr deren Wunden mit Triagenverbänden versorgt. Ihr müsst 15 Patienten retten, bevor 6 von ihnen ihren Verletzungen erliegen.\n\nDenkt an die Einhaltung der Reihenfolge! Schwerstverletzte Soldaten sterben am schnellsten, dann die schwer verletzten Soldaten. Bei verletzten Soldaten dauert es etwas länger, bis sie sterben. Ihr solltet sie retten, NACHDEM Ihr die schwerstverletzten und schwer verletzten Soldaten selektiert habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - 15 Patienten gerettet!",
    [6761] = "Sprecht mit Mathrengyl Bärenfährte in der Enklave des Cenarius von Darnassus.",
    [6762] = "Sprecht mit Rabine Saturna im Dorf Nachthafen auf der Mondlichtung. Die Mondlichtung liegt zwischen dem Teufelswald und Winterquell, und Ihr erreicht es über den Pfad, der aus der Holzschlundfeste herausführt.",
    [6844] = "Bringt das verkrustete Silithidenobjekt zu Umber, dem Archivar des Zirkels des Cenarius, ins Dorf Nachthafen auf der Mondlichtung.",
    [6845] = "Sprecht mit Rabine Saturna im Dorf Nachthafen auf der Mondlichtung.",
    [7003] = "Benutzt Zorbins Ultraschrumpfer um jegliche Art von Riesen in Feralas in eine handlichere Form zu schrumpfen. Bringt Zorbin von Schiller 15 Schrumpfüberreste von diesen Riesen. Ihr findet Ihn bei den Docks, an der vergessenen Küste in Feralas.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schrumpfüberreste x 15",
    [7492] = "Sprecht mit Talo Dornhuf in Camp Mojache, in Feralas.",
    [7601] = "Sprecht mit Impsy im Teufelswald.",
    [7701] = "Tief in der Schlackengrube des Kessels in der sengenden Schlucht werdet Ihr den verräterischen Dunkeleisenzwerg, Aufseher Maltorius, finden. \n\nTötet den Aufseher Maltorius und nehmt seinen Kopf an Euch. Bringt diesen zum Hauptmann des Ausgucks Lolo Langhieb in der sengenden Schlucht für eine Belohnung.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kopf des Aufsehers Maltorius x 1",
    [7702] = "Tief in der Schlackengrube des Kessels, findet Ihr die Schlafräume der Dunkeleisenzwerge.\n\nFindet diese Schlafkammern und stibitzt 20 Dunkeleisenkissen. Kehrt dann zu Evonice Rußraucher in der sengenden Schlucht, wenn Ihr die Aufgabe erfüllt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Dunkeleisenkissen x 20",
    [7721] = "Sammelt 10 Wasserelementarkerne von den Meereselementaren und Meeresschauern entlang der Vergessenen Küste von Feralas und bringt sie zurück zu Zorbin von Schiller in der Nähe des dortigen Docks.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wasserelementarkerne x 10",
    [7722] = "Irgendwo in der Schlackengrube des Kessels findet Ihr die geheimen Pläne des Feurigen Fluxus, die der Aufseher Maltorius stahl. Findet diese Pläne und bringt sie zurück zu Meisterschmied Burninate in der sengenden Schlucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geheimpläne: Feuriger Fluxus x 1",
    [7723] = "Hansel Bleihand möchte, dass Ihr 20 Schwere Kriegsgolems tötet. \n\nDie Schweren Kriegsgolems wandern in der Gegend um den Kessel in der sengenden Schlucht herum. Sobald Ihr genug getötet habt, kehrt zu Hansel zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schwerer Kriegsgolem x 20",
    [7724] = "Hansel Bleihand möchte, dass Ihr 20 große Lavaspinnen in der sengenden Schlucht tötet. \n\nDie großen Lavaspinnen findet Ihr auf den Plateaus und in den Lavabecken der sengenden Schlucht. Sobald Ihr genug getötet habt, kehrt zu Hansel zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Große Lavaspinne x 20",
    [7727] = "Hansel Bleihand möchte, dass Ihr 20 Incendosaurier tötet.\n\nDie Incendosaurier haben sich in den Lavabecken der Schlackengrube eingenistet. Ihr findet die Schlackengrube im Kessel der sengenden Schlucht.\n\nSobald Ihr genug Incendosaurier getötet habt, kehrt zu Hansel Bleihand in der sengenden Schlucht zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Incendosaurier x 20",
    [7728] = "Sucht die Schmiedewindform und das Ausguckhandfernrohr. Bringt diese Gegenstände zu Zuchtmeister Skrange in der sengenden Schlucht.\n\nDie einzigen Informationen die Ihr habt sind: Die Schmiedewindform ist ein Schmiedewerkzeug welches von Schmieden verwendet wird und das Ausguckhandfernrohr ist ein unverzichtbares Werkzeug für Spähposten.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schmiedewindform x 1\n - Ausguckhandfernrohr x 1",
    [7729] = "Tötet 15 Zuchtmeister der Dunkeleisenzwerge und 15 Sklavenhändler der Dunkeleisenzwerge. Kehrt zu Zuchtmeister Skrange in der sengenden Schlucht zurück, sobald Ihr die Aufgabe erfüllt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Zuchtmeister der Dunkeleisenzwerge x 15\n - Sklavenhändler der Dunkeleisenzwerge x 15",
    [7730] = "Bringt Hadoken Flinkschreiter im Camp Mojache in Feralas 20 Zukk'ashknochenpanzer.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Zukk'ashknochenpanzer x 20",
    [7731] = "Besiegt Zornstachel in der verwundenen Tiefe und bringt seine Drüsen zu Hadoken Flinkschreiter im Camp Mojache in Feralas zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Zornstachels Drüsen x 1",
    [7732] = "Bringt den Bericht über die Zukk'ash aus Camp Mojache zu Zilzibin Tomtom. Er wohnt in der Gasse von Orgrimmar.",
    [7733] = "Bringt Pratt McGrubben in der Mondfederfeste in Feralas 10 Wutschrammyetibälge.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wutschrammyetibalg x 10",
    [7734] = "Bringt Jangdor Flinkschreiter im Camp Mojache in Feralas 10 Wutschrammyetibälge.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wutschrammyetibalg x 10",
    [7735] = "Bringt Pratt McGrubben in der Mondfederfeste in Feralas den makellosen Yetibalg.",
    [7738] = "Bringt Jangdor Flinkschreiter im Camp Mojache in Feralas den makellosen Yetibalg.",
    [7815] = "Katoom, der Angler aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr 10 Salzwasserschnappkiefer tötet. Kehrt zu ihm zurück, sobald Ihr Eure Aufgabe erledigt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Salzwasserschnappkiefer x 10",
    [7816] = "Katoom, der Angler aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr Gammerita tötet und Katooms besten Köder aus ihrem Kadaver holt.\n\nKatoom meinte, dass Gammerita sich an der Küste bei den anderen Schildkröten aufhält.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Katooms bester Köder x 1",
    [7817] = "|Cffffd100Anforderungen:|r\n - Magiestoff x 60",
    [7828] = "Jäger Markhor aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr 5 Silbermähnenpirscher und 5 Silbermähnenheuler tötet. Kehrt zu ihm zurück, sobald Ihr Eure Aufgabe erledigt habt.\n\nMarkhor erwähnte, dass sich die Wölfe in der Wildnis des Hinterlands verstecken.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Silbermähnenpirscher x 5\n - Silbermähnenheuler x 5",
    [7829] = "Jäger Markhor aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr 10 Wilde Eulenbestien tötet. Kehrt zu ihm zurück, sobald Ihr Eure Aufgabe erledigt habt.\n\nMarkhor erwähnte, dass sich die Eulenbestien in der Wildnis des Hinterlands befinden.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wilde Eulenbestie x 10",
    [7830] = "Jäger Markhor aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr einen Klingenschnabelhimmelsfürsten tötet und dessen Federbusch an Euch nehmt. Kehrt zu ihm zurück sobald Ihr diese Aufgabe erledigt habt.\n\nDie Klingenschnabelhimmelsfürsten sind eine recht seltene Spezies und nisten meist in der Wildnis des Hinterlands.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Himmelsfürstenfederbusch x 1",
    [7839] = "Schmied Aschenbaum aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr seine verlorenen Werkzeuge ausfindig macht und dann zu ihm zurückkehrt.\n\nIhr erinnert Euch an Schmied Aschenbaums Worte, dass die Werkzeuge möglicherweise bei einem der Tempel der Blutfratzen zu finden seien, im Nordosten des Hinterlands. Ihr solltet auch den Lauerfels absuchen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Aschenbaums verlorene Werkzeuge x 1",
    [7840] = "Lard aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr Lards Brotzeit wieder findet. Kehrt nach Erfüllung dieser Aufgabe zu ihm zurück.\n\nLard erwähnte, dass er es auf der Insel im Norden vergessen habe. Achtet auf die Trolle der Blutfratzen.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Lards Brotzeit x 1",
    [7841] = "Otho Moji'ko aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr 5 Hochtalkundschafterinnen, 8 Hochtalspäher, 2 Hochtalschützen und 5 Hochtalwaldläuferinnen tötet. Kehrt nach vollendeten Taten zu ihm zurück.\n\nIhr findet die Hochtalelfen bei der Jagdhütte von Quel'Danil im Nordwesten des Hinterlands.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hochtalspäher x 8\n - Hochtalkundschafterin x 5\n - Hochtalwaldläuferin x 5\n - Hochtalschütze x 2",
    [7842] = "Otho Moji'ko aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr ihm 1 lange elegante Feder von Greifen besorgt, die das Hinterland bewohnen. Kehrt mit der Feder zu ihm zurück.\n\nEs ist bekannt, dass Greifen überall im Hinterland zu finden sind.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Lange elegante Feder x 1",
    [7843] = "Otho Moji'ko aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr zum Nistgipfel im Westen des Hinterlands reist und die letzte Botschaft an die Wildhämmer beim Brunnen im Stadtzentrum platziert. Kehrt nach Vollendung der Aufgabe zu ihm zurück.\n\nHütet Euch vor zornigen Wildhammerzwergen und niederträchtigen Mitgliedern der Allianz.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Botschaft an die Wildhämmer überbracht",
    [7844] = "Mystikerin Yayo'jin aus dem Dorf der Bruchhauer im Hinterland möchte, dass Ihr 6 Skalpierer der Blutfratzen und 2 Sterndeuter der Blutfratzen tötet. Kehrt nach Vollendung dieser Aufgabe zu ihr zurück.\n\nYayo'jin deutete an, dass man diese Trolle nahe der Tempel von Shaol'watha und Agol'watha finden könnte. Sie liegen im Nordosten des Hinterlands.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Skalpierer der Blutfratzen x 6\n - Sterndeuter der Blutfratzen x 2",
    [8151] = "Sprecht mit Ogtinc in Azshara.",
    [8153] = "Bringt ein Paar perfekte Rennergeweihe zu Ogtinc nach Azshara. Er befindet sich auf den Klippen nordöstlich der Ruinen von Eldarath.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Perfektes Rennergeweih x 2",
    [8231] = "Bringt 6 Wellenhauerschuppen zu Ogtinc in Azshara. Ogtinc wohnt oberhalb des Kliffs, nordöstlich der Ruinen von Eldarath.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wellenhauerschuppen x 6",
    [8250] = "Sucht nach Sanath Lim-yo und verschafft Euch Zugang zu Erzmagier Xylem.",
    [8251] = "Bringt Erzmagier Xylem in Azshara 10 glitzernde Staubproben.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Glitzernder Staub x 10",
    [8252] = "Sammelt 6 verzauberte Korallen und bringt sie zum Erzmagier Xylem.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Verzauberte Koralle x 6",
    [8254] = "Sucht Ogtinc in Azshara auf.",
    [8255] = "Beschafft 4 gesunde Rennerdrüsen und bringt sie zu Ogtinc in Azshara. Ihr findet ihn auf den Klippen, nordöstlich der Ruinen von Eldarath.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gesunde Rennerdrüse x 4",
    [8256] = "Beschafft ein Sekret des Untodes für Ogtinc in Azshara. Ihr findet ihn auf den Klippen, nordöstlich der Ruinen von Eldarath.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Sekret des Untodes x 1",
    [8275] = "Sprecht mit Windruferin Prachthorn auf Burg Cenarius in Silithus.",
    [8276] = "Sprecht mit Windruferin Prachthorn auf Burg Cenarius in Silithus.",
    [8277] = "Beetix Wankelhupf von der Burg Cenarius in Silithus möchte, dass Ihr 8 Stachel von Steinpanzerskorpiden und 8 Giftzähne von Sandhuschern für sie sammelt. Kehrt zu ihr zurück, sobald Ihr diese Aufgabe erfüllt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Steinpanzerskorpidstachel x 8\n - Sandhuschergiftzahn x 8",
    [8278] = "Beetix Wankelhupf von der Burg Cenarius in Silithus möchte, dass Ihr je 3 Stachel von Steinpanzerzangen und Steinpanzerschindern, sowie 3 Felspirschergiftzähne für sie sammelt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Steinpanzerschinderstachel x 3\n - Steinpanzerzangenstachel x 3\n - Felspirschergiftzahn x 3",
    [8279] = "Bringt Ortell dem Einsiedler in Silithus die drei Kapitel des Lexikons des Schattenhammerklans.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Lexikon des Schattenhammerklans - Kapitel 1 x 1\n - Lexikon des Schattenhammerklans - Kapitel 2 x 1\n - Lexikon des Schattenhammerklans - Kapitel 3 x 1",
    [8280] = "Windruferin Prachthorn auf Burg Cenarius in Silithus möchte, dass Ihr 15 Baggerschläger tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Baggerschläger x 15",
    [8281] = "Windruferin Prachthorn auf Burg Cenarius in Silithus möchte, dass Ihr 20 Baggerbrecher tötet.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Baggerbrecher x 20",
    [8282] = "Spürt Noggles Ranzen im südlichen Gebirge von Silithus auf und bringt ihn zu ihm, auf Burg Cenarius, zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Noggles Ranzen x 1",
    [8283] = "Bringt Totenstachels Zange zu Vish Kozus, Hauptmann der Wache.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Totenstachels Zange x 1",
    [8284] = "Geologin Lerchenbann auf Burg Cenarius in Silithus möchte, dass Ihr ihr 8 Schrifttafelfragmente des Schattenhammerklans bringt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schrifttafelfragment des Schattenhammerklans x 8",
    [8285] = "Bringt die wiederhergestellte Schrifttafel zu Ortell dem Einsiedler in Silithus.",
    [8287] = "Bringt Kommandant Mar'alith die entschlüsselte Abschrift der Schrifttafel.",
    [8304] = "Kommandant Mar'alith auf Burg Cenarius in Silithus möchte, dass Ihr die Bewohner von Bronzebarts Lager befragt. Das Lager befindet sich südlich von Burg Cenarius.\n\nKehrt zu Kommandant Mar'alith zurück, wenn Ihr die benötigten Informationen gesammelt habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Frankal befragt x 1\n - Rutgar befragt x 1",
    [8308] = "Liefert Brann Bronzebarts verlorenen Brief in Bronzebarts Lager im südlichen Silithus ab.",
    [8318] = "Bringt Bor Wildmähne auf Burg Cenarius 10 verschlüsselte Schattenhammertexte.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Verschlüsselter Schattenhammertext x 10",
    [8320] = "Tötet 10 Zwielichtgeolords und kehrt anschließend zu Huum Wildmähne auf Burg Cenarius zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Zwielichtgeolord x 10",
    [8323] = "Ortell der Einsiedler möchte, dass Ihr ihm 10 verschlüsselte Schattenhammertexte beschafft.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Verschlüsselter Schattenhammertext x 10",
    [8361] = "Bor Wildmähne auf Burg Cenarius in Silithus möchte, dass Ihr einen abyssischen Templer vernichtet und ihm dessen abyssisches Wappen als Beweis für Eure Tat bringt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Abyssisches Wappen x 1",
    [8365] = "Sammelt 20 Südmeerpiratenhüte und bringt sie zurück zur eingebildeten Modeschöpferin beim Dampfdruckpier in Tanaris.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Südmeerpiratenhut x 20",
    [8366] = "Sicherheitschef Bilgenritzel beim Dampfdruckpier in Tanaris beauftragt Euch, 10 Piraten der Südmeerfreibeuter, 10 Seeräuber der Südmeerfreibeuter, 10 Dockarbeiter der Südmeerfreibeuter und 10 Schwadroneure der Südseefreibeuter zu töten.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Pirat der Südmeerfreibeuter x 10\n - Seeräuber der Südmeerfreibeuter x 10\n - Dockarbeiter der Südmeerfreibeuter x 10\n - Schwadroneur der Südmeerfreibeuter x 10",
    [8410] = "Bath'rah der Windbehüter möchte, dass Ihr jeweils eine Probe Luft, Feuer, Erde und Wasser für ihn sammelt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Elementarluft x 1\n - Elementarfeuer x 1\n - Elementarerde x 1\n - Elementarwasser x 1",
    [8412] = "Bringt Bath'rah dem Windbehüter die Komponenten für das Geistertotem.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Blutunterlaufenes Spinnenauge x 8\n - Dicke schwarze Klaue x 8",
    [8413] = "Bringt Bath'rah dem Windbehüter die Voodoofedern.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gelbe Voodoofeder x 2\n - Blaue Voodoofeder x 2\n - Grüne Voodoofeder x 2",
    [8414] = "Sammelt 20 Geißelsteine des Dieners und bringt sie zu Hohepriester Thel'danis in den westlichen Pestländern.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Geißelstein des Dieners x 20",
    [8415] = "Sprecht mit Kommandant Ashlam Ehrenschlag im Zugwindlager.",
    [8416] = "Bringt den gereinigten Geißelstein zu Kommandant Ashlan Ehrenschlag an der Zugwindspitze.",
    [8417] = "Sprecht mit dem gefallenen Helden der Horde am Eingang zu den verwüsteten Landen.",
    [8418] = "Beschafft Euch gelbe, blaue und grüne Voodoofedern von den Trollen im Versunkenen Tempel.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gelbe Voodoofeder x 2\n - Blaue Voodoofeder x 2\n - Grüne Voodoofeder x 2",
    [8419] = "Bringt ein Stück Teufelsstoff zu Impsy im Teufelswald.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Teufelsstoff x 1",
    [8421] = "Bringt 10 Stück faules Holz und 4 Blutgiftessenzen zu Impsy im Teufelswald.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Faules Holz x 10\n - Blutgiftessenz x 4",
    [8423] = "Tötet 7 Hölleneber in den verwüsteten Landen und kehrt zu dem gefallenen Helden der Horde zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Hölleneber x 7",
    [8424] = "Merzt die Schattenanbeter in den verwüsteten Landen aus und kehrt zum gefallenen Helden der Horde zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Adept der Schattenanbeter x 20\n - Kultist der Schattenanbeter x 10\n - Rohling der Schattenanbeter x 20",
    [8460] = "Grazle möchte, dass Ihr Euch beweist, indem Ihr 6 Krieger der Totenwaldfelle, 6 Pfadfinder der Totenwaldfelle und 6 Gärtner der Totenwaldfelle besiegt. Kehrt zu ihm in den Süden des Teufelswalds nahe des Smaragdrefugiums zurück, sobald Ihr dies getan habt.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Krieger der Totenwaldfelle x 6\n - Pfadfinder der Totenwaldfelle x 6\n - Gärtner der Totenwaldfelle x 6",
    [8461] = "Nafien möchte, dass Ihr 6 Höhlenbehüter der Totenwaldfelle, 6 Rächer der Totenwaldfelle und 6 Schamanen der Totenwaldfelle besiegt. Kehrt danach zu ihm in den Norden des Teufelswalds nahe des Eingangs der Holzschlundfeste zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Höhlenbehüter der Totenwaldfelle x 6\n - Rächer der Totenwaldfelle x 6\n - Schamane der Totenwaldfelle x 6",
    [8462] = "Reist nach Norden entlang der Hauptstraße des Teufelswalds und sprecht mit einem Furbolg namens Nafien. Er hält außerhalb des Eingangs zur Holzschlundfeste Wache.",
    [8464] = "Salfa möchte, dass Ihr 8 Schamanen der Winterfelle, 8 Höhlenbehüter der Winterfelle und 8 Ursa der Winterfelle erledigt. Salfa befindet sich genau außerhalb des Eingangs zur Holzschlundfeste in Winterquell.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Schamane der Winterfelle x 8\n - Höhlenbehüter der Winterfelle x 8\n - Ursa der Winterfelle x 8",
    [8465] = "Durchquert die Holzschlundfeste und verlasst sie in Richtung Winterquell. Sprecht mit Salfa, die außerhalb des Eingangs zur Holzschlundfeste Wache steht.",
    [8467] = "|Cffffd100Anforderungen:|r\n - Kopfputzfeder der Totenwaldfelle x 5",
    [8551] = "Bringt Smotts' Truhe zu Hecklebury Smotts nach Beutebucht.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Smotts' Truhe x 1",
    [9051] = "Stecht einen Teufelssaurier mit dem Teufelssaurierhaken und kehrt danach zu Torwa Pfadfinder im Krater von Un'Goro zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Teufelssaurier mit der gezackten Teufelssaurierklinge erstochen.",
    [9052] = "Sammelt 8 Blutkappenpilze und 8 Gorishistachel und kehrt zu Torwa Pfadfinder im Krater von Un'Goro zurück.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Gorishistachel x 8\n - Blutkappenpilz x 8",
    [9063] = "Sprecht im Krater von Un'Goro mit Torwa Pfadfinder.",
    [9124] = "Jäger Leopold bei der Kapelle des hoffnungsvollen Lichts in den östlichen Pestländern möchte 30 Teile einer Gruftbestie.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Teile einer Gruftbestie x 30",
    [9126] = "Rohan der Assassine bei der Kapelle des hoffnungsvollen Lichts in den östlichen Pestländern möchte 30 Knochenfragmente.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Knochenfragmente x 30",
    [9128] = "Erzmagierin Angela Dosantos bei der Kapelle des hoffnungsvollen Lichts in den östlichen Pestländern möchte 30 Kerne der Elemente.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Kern der Elemente x 30",
    [9131] = "Korfax bei der Kapelle des hoffnungsvollen Lichts in den östlichen Pestländern möchte 30 Dunkeleisenfragmente.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Dunkeleisenfragmente x 30",
    [9136] = "Rayne bei der Kapelle des hoffnungsvollen Lichts in den östlichen Pestländern möchte 30 Wildwedel.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Wildwedel x 30",
    [9141] = "Einsatzkommandant Metz bei der Kapelle des hoffnungsvollen Lichts in den östlichen Pestländern möchte eine Ehrenmarke der Argentumdämmerung.\n|Cffffd100 |r\n|Cffffd100Anforderungen:|r\n - Ehrenmarke der Argentumdämmerung x 1",
    [9416] = "Sprecht mit General Kirika beim Lager der Horde in der Nähe des Regalschwarmbaus.",
